import React, { useEffect } from 'react'
import * as fuelService from '../../services/fuel';

const Home = () => {

    useEffect(() => {
        const fetchData = async () => {
            const fuel_prices = await fuelService.getAll()
            console.log(fuel_prices)
        }
        fetchData();
    }, [])
    return (
        <div>
            HomePage
        </div>
    )
}

export default Home
